import './Login.css';

export function Login() {
    return ( 
        <>
         <div className="FormContainer">
            <div className="Title2"><h3>Log In!</h3></div>
            <div className="labinput">
            <label htmlFor="text">Username</label>
            <input type="name" />
            </div>
            <div className="labinput">
            <p>Password</p>
            <input type="password" />
            </div>
            <div className="btn"><button className="btn btn-primary">Sign In</button></div>
         </div>
        </>
    )
}
